import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import state from './redux/state';



ReactDOM.render(<App state={s} posts={posts} dialogs={dialogs} messages={messages} />, document.getElementById('root'));

